import React from "react";

export default function TokenAddressInput({ setAssetA, setAssetB }) {
  return (
    <div>
      <p>Both Tokens:</p>
      <input placeholder="Contract Address" onChange={(event) => setAssetA(event.target.value)}></input>
      <input placeholder="Contract Address" onChange={(event) => setAssetB(event.target.value)}></input>
    </div>
  );
}
